import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../contexts/AuthContext';
import { ArrowLeft, Shield, ShieldOff } from 'lucide-react';
import './UserManagement.css';

function UserManagement() {
  const navigate = useNavigate();
  const { user } = useAuth();
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (!user || !user.is_admin) {
      navigate('/admin');
      return;
    }
    loadUsers();
  }, [user, navigate]);

  const loadUsers = async () => {
    try {
      const res = await axios.get('/api/admin/users');
      setUsers(res.data);
    } catch (error) {
      console.error('Error loading users:', error);
      alert('Failed to load users');
    } finally {
      setLoading(false);
    }
  };

  const toggleAdmin = async (userId, currentStatus) => {
    if (!window.confirm(`Are you sure you want to ${currentStatus ? 'remove admin privileges from' : 'grant admin privileges to'} this user?`)) {
      return;
    }
    try {
      await axios.put(`/api/admin/users/${userId}`, { is_admin: !currentStatus });
      loadUsers();
    } catch (error) {
      alert(error.response?.data?.error || 'Failed to update user');
    }
  };

  if (loading) return <div className="admin-loading">Loading...</div>;

  return (
    <div className="user-management">
      <div className="management-header">
        <button onClick={() => navigate('/admin')} className="btn-back">
          <ArrowLeft /> Back
        </button>
        <h1>User Management</h1>
      </div>

      <div className="users-table">
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Email</th>
              <th>Display Name</th>
              <th>XP</th>
              <th>Level</th>
              <th>Admin</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.map(userItem => (
              <tr key={userItem.id}>
                <td>{userItem.id}</td>
                <td>{userItem.email}</td>
                <td>{userItem.display_name || 'N/A'}</td>
                <td>{userItem.total_xp || 0}</td>
                <td>{userItem.level || 1}</td>
                <td>{userItem.is_admin ? 'Yes' : 'No'}</td>
                <td>
                  <button
                    onClick={() => toggleAdmin(userItem.id, userItem.is_admin)}
                    className={`btn-toggle-admin ${userItem.is_admin ? 'is-admin' : ''}`}
                    disabled={userItem.id === user.id}
                  >
                    {userItem.is_admin ? (
                      <>
                        <ShieldOff /> Remove Admin
                      </>
                    ) : (
                      <>
                        <Shield /> Make Admin
                      </>
                    )}
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default UserManagement;
